import React from 'react';



const useStyles = makeStyles(theme => ({
	root: {
		display: 'flex',
		flexDirection: 'column',
		flexWrap: 'nowrap',
		justifyContent: 'center',
	},
}));

export default function Base() {
	const classes = useStyles();

	return (
		<div className={classes.root}>
		</div>
	);
}
